	('e975aa27-eb9c-4090-97e5-0fcd2a564ac7', 'bf87e591-101c-4629-8b01-502871c99862', 'ru', 'Псориатический артрит', 'Псориатический артрит - это воспалительное заболевание суставов, которое развивается у людей с псориазом.', '{"Боль в суставах","Отек пальцев","Поражение кожи","Изменения ногтей"}', '{"Противовоспалительные препараты",Иммуносупрессоры,"Биологическая терапия","Местное лечение"}', '{"Контроль веса","Защита от травм","Уход за кожей","Регулярные осмотры"}', NULL, NULL, 'psoriaticheskiy-artrit-ru', '2025-09-25 21:55:19.507055+00', '2025-09-25 21:55:19.507055+00'),
