	('518487c8-1cf3-4635-96ee-2709f45fb9cd', 'caa023ce-b8eb-4297-b036-794660e595c3', 'en', 'Axial Spondyloarthritis', 'Axial spondyloarthritis is a chronic inflammatory disease that primarily affects the spine and sacroiliac joints.', '{"Lower back pain","Morning stiffness","Limited spinal mobility",Fatigue}', '{"Anti-inflammatory drugs","Biological therapy",Physiotherapy,"Therapeutic exercises"}', '{"Regular exercise","Proper posture","Quit smoking","Healthy diet"}', NULL, NULL, 'aksialniy-spondiloartrit-en', '2025-09-25 21:55:19.507055+00', '2025-09-25 21:55:19.507055+00'),
	('4bbc7bd1-26fb-4146-a1cc-ae84a23d49c2', 'ba4df0ec-1b5f-4e37-8c62-fcfefaf30a2b', 'en', 'Rheumatoid Arthritis', 'Rheumatoid arthritis is a chronic autoimmune disease that causes joint inflammation.', '{"Joint pain","Joint swelling","Morning stiffness",Fatigue,Fever}', '{Methotrexate,"Biological drugs",Corticosteroids,Physiotherapy}', '{"Healthy lifestyle","Regular exercise","Balanced nutrition","Quit smoking"}', NULL, NULL, 'revmatoidniy-artrit-en', '2025-09-25 21:55:19.507055+00', '2025-09-25 21:55:19.507055+00'),
	('a1e85ebf-382c-4466-b4b1-133b8cc277df', 'bf87e591-101c-4629-8b01-502871c99862', 'en', 'Psoriatic Arthritis', 'Psoriatic arthritis is an inflammatory joint disease that develops in people with psoriasis.', '{"Joint pain","Finger swelling","Skin lesions","Nail changes"}', '{"Anti-inflammatory drugs",Immunosuppressants,"Biological therapy","Topical treatment"}', '{"Weight control","Injury protection","Skin care","Regular checkups"}', NULL, NULL, 'psoriaticheskiy-artrit-en', '2025-09-25 21:55:19.507055+00', '2025-09-25 21:55:19.507055+00'),
