	('a3788fae-a0ae-4e61-94a4-db1d7b26cda7', 'Mirziyod  Vasiljonovich', 'tta2005@mail.ru', '+99871 150-97-76', 'Revmatolog', 10, '', '', '', true, true, 10, '2025-09-26 04:31:35.085769+00', '2025-09-26 04:31:35.085769+00'),
	('81c6352c-6446-4749-be32-8422e7688ef3', 'Mirahmedova Hilola To''xtasinovna', 'Hilola_mirahmedova@mail.ru', '+998 55 517 04 24', 'Revmatologiya', 24, '1997-1999 yillarda 2-Toshkent Davlat tibbiyot instituti ixtisoslashtirilgan artrologiya markazida artrolog.2019 yildan hozirgacha – TMA 1-son ichki kasalliklar propedevtikasi kafedrasi mudiri.', '', '{dotsent}', true, true, 12, '2025-09-26 04:31:35.085769+00', '2025-09-26 04:31:35.085769+00'),
	('478d5be2-81c1-4878-b66e-b3ad63ad1248', 'Dildora Abdumalikovna Nabiyeva', 'tta2003@mail.ru', '+99871 150 97 76', 'Revmatologiya', 26, 'TMA №1 fakultet va gospital terapiya kafedrasi dotsenti, fan nomzodi. 1997 yilda Ikkinchi Toshkent tibbiyot institutini davolash yo‘nalishi bo‘yicha tamomlagan. 75 ta ilmiy ish, shu jumladan 4 ta oʻquv-uslubiy qoʻllanma muallifi. 2003 yilda “Keksa yoshdan boshlab revmatoid artritning diagnostikasi va davolash xususiyatlari” mavzusida nomzodlik dissertatsiyasini himoya qildi. Asosiy ilmiy yo''nalish: «Qonning turli seroz tizimi bilan og''rigan bemorlarda ankiloz spondiloartritning klinik kechishi va davolash». 2012 yildan kafedraning o‘quv ishlariga mas’ul.', '', '{dotsent}', true, true, 11, '2025-09-26 04:22:26.147823+00', '2025-09-26 04:22:26.147823+00');
INSERT INTO "public"."doctor_translations" ("id", "doctor_id", "language", "bio", "specialization", "created_at", "updated_at") VALUES
	('490438fb-81bc-432e-a0ba-a281928b7b19', 'a3788fae-a0ae-4e61-94a4-db1d7b26cda7', 'ru', '', 'Ревматология', '2025-09-25 03:18:47.66655+00', '2025-09-25 03:18:47.66655+00'),
	('13e3c2e5-4039-4bf3-b5e8-9b5d51a466cc', 'a3788fae-a0ae-4e61-94a4-db1d7b26cda7', 'en', '', 'Revmatolog', '2025-09-25 03:18:47.66655+00', '2025-09-25 03:18:47.66655+00'),
	('d1261d78-e52d-4d57-977a-047dab076bb3', '478d5be2-81c1-4878-b66e-b3ad63ad1248', 'ru', 'Доцент кафедры факультетской и госпитальной терапии ТМА № 1, кандидат медицинских наук. Окончил Второй Ташкентский медицинский институт в 1997 году по специальности «терапия». Автор 75 научных работ, в том числе 4 учебно-методических пособий. В 2003 году защитил кандидатскую диссертацию на тему «Диагностика и особенности лечения ревматоидного артрита в пожилом возрасте». Основное научное направление: «Клиника и лечение болезни Бехтерева у больных с различными серозными системами крови». С 2012 года отвечает за учебную работу кафедры.', 'Ревматология', '2025-09-26 04:22:26.647439+00', '2025-09-26 04:22:26.647439+00'),
	('764ec3e3-10b3-49fa-857c-658ccf292166', '478d5be2-81c1-4878-b66e-b3ad63ad1248', 'en', 'Associate Professor of the Department of Faculty and Hospital Therapy of TMA No. 1, Candidate of Sciences. Graduated from the Second Tashkent Medical Institute in 1997 with a degree in therapy. Author of 75 scientific works, including 4 teaching and methodological manuals. In 2003, he defended his candidate''s dissertation on the topic "Diagnosis and features of treatment of rheumatoid arthritis in old age." Main scientific direction: "Clinical course and treatment of ankylosing spondylitis in patients with various serous blood systems." Since 2012, he has been responsible for the educational work of the department.', 'Rheumatology', '2025-09-26 04:22:26.647439+00', '2025-09-26 04:22:26.647439+00'),
	('aa099020-a388-4fe2-a4b1-1a001b59a583', '81c6352c-6446-4749-be32-8422e7688ef3', 'ru', 'В 1997–1999 годах – врач-артролог Специализированного артрологического центра 2-го Ташкентского государственного медицинского института.
