	('b1a6bff5-e395-45c5-a3ab-55cf996484dd', 'Azizbek Karimov', 25, 'Revmatoyid artrit', 'Azizbek Karimov 25 yoshda, u bo‘g‘imlarda doimiy og‘riq va shish sababli shifokorga murojaat qilgan. Tekshiruv natijasida unga revmatoyid artrit tashxisi qo‘yilgan. Dastlabki oylar og‘riqlar kuchli bo‘lgan, lekin muntazam davolash jarayonidan so‘ng ahvoli yaxshilana boshlagan.', '6', 'Hozirgi kunda bemor og‘riqlari ancha kamaygan, harakatlanish imkoniyati kengaygan.', 'Mirziyod  Vasiljonovich', NULL, true, 40, '2025-09-28 11:21:56.657052+00', '2025-09-28 11:21:56.657052+00', 'text', true, 'The patient reduced salt and fat intake, performs regular light exercises, and has established a healthy sleep routine.', '{"Bo‘g‘im og‘rig‘i","Shish va qizarish","Ertalabki qotib qolish"}', '{"Dorivor terapiya","Fizioterapiya mashg‘ulotlari","Sog‘lom ovqatlanish"}', '{Metotreksat,"Yallig‘lanishga qarshi preparatlar","Og‘riq qoldiruvchi vositalar"}', 4, 'Revmatoyid artrit: 25 yoshli bemor hikoyasi', '25 yoshli bemor Azizbek Karimovning revmatoyid artrit tashxisi, davolash jarayoni va ijobiy natijalari haqida qisqa hikoya.', NULL);
