	('a4b1ef89-9c5c-482c-80a5-bfdba4a83c27', '88575805-229f-4ce5-bdb6-590f04195fb9', 'uz', 'yana suratli test', 'yana suratli test', 'yana suratli test', 'yana suratli test', 'yana suratli test', 'yana suratli test', '2025-09-20 06:29:04.823204+00', '2025-09-20 06:29:04.823204+00', 'yana suratli test', '{"yana suratli test"}', '{"yana suratli test"}', '{"yana suratli test"}', 'yana suratli test', 'yana suratli test'),
	('d7ad58f5-2380-42c9-bbc7-dff5115fb6af', 'b1a6bff5-e395-45c5-a3ab-55cf996484dd', 'uz', 'Azizbek Karimov', 'Revmatoyid artrit', 'Azizbek Karimov 25 yoshda, u bo‘g‘imlarda doimiy og‘riq va shish sababli shifokorga murojaat qilgan. Tekshiruv natijasida unga revmatoyid artrit tashxisi qo‘yilgan. Dastlabki oylar og‘riqlar kuchli bo‘lgan, lekin muntazam davolash jarayonidan so‘ng ahvoli yaxshilana boshlagan.', '6', 'Hozirgi kunda bemor og‘riqlari ancha kamaygan, harakatlanish imkoniyati kengaygan.', 'Mirziyod  Vasiljonovich', '2025-09-28 11:21:57.205837+00', '2025-09-28 11:21:57.205837+00', 'The patient reduced salt and fat intake, performs regular light exercises, and has established a healthy sleep routine.', '{"Bo‘g‘im og‘rig‘i","Shish va qizarish","Ertalabki qotib qolish"}', '{"Dorivor terapiya","Fizioterapiya mashg‘ulotlari","Sog‘lom ovqatlanish"}', '{Metotreksat,"Yallig‘lanishga qarshi preparatlar","Og‘riq qoldiruvchi vositalar"}', 'Revmatoyid artrit: 25 yoshli bemor hikoyasi', '25 yoshli bemor Azizbek Karimovning revmatoyid artrit tashxisi, davolash jarayoni va ijobiy natijalari haqida qisqa hikoya.'),
	('2d1f4c97-b9f2-4bea-9d87-1fc6ff54211e', 'b1a6bff5-e395-45c5-a3ab-55cf996484dd', 'ru', 'Азизбек Каримов', 'ревматоидный артрит', 'Азизбек Каримов, 25 лет, обратился к врачу из-за постоянных болей и отёков в суставах. После обследования был поставлен диагноз ревматоидный артрит. В первые месяцы боли были сильными, но после регулярного лечения его состояние постепенно улучшилось.', '6', 'На данный момент боли значительно уменьшились, подвижность суставов улучшилась.', 'Mirziyod  Vasiljonovich', '2025-09-28 11:21:57.59995+00', '2025-09-28 11:21:57.59995+00', '', '{}', '{}', '{}', 'Ревматоидный артрит: история пациента 25 лет', 'История Азизбека Каримова, 25 лет, которому поставлен диагноз ревматоидный артрит. Лечение, изменения в образе жизни и положительные результаты терапии.'),
	('d2682208-9d57-4fb9-9c65-0d6eb0ba8676', 'b1a6bff5-e395-45c5-a3ab-55cf996484dd', 'en', 'Azizbek Karimov', 'rheumatoid arthriti', 'Azizbek Karimov, 25 years old, consulted a doctor due to persistent joint pain and swelling. After examination, he was diagnosed with rheumatoid arthritis. During the first months, the pain was severe, but after consistent treatment his condition started to improve.', '6', 'Currently, the patient’s pain has significantly decreased and joint mobility has improved.', 'Mirziyod  Vasiljonovich', '2025-09-28 11:21:57.59995+00', '2025-09-28 11:21:57.59995+00', '', '{}', '{}', '{}', 'Rheumatoid arthritis: case story of a 25-year-old patient', 'The story of 25-year-old patient Azizbek Karimov diagnosed with rheumatoid arthritis. Treatment process, lifestyle changes, and positive results.');
INSERT INTO "public"."post_translations" ("id", "post_id", "language", "title", "content", "excerpt", "meta_title", "meta_description", "slug", "created_at", "updated_at") VALUES
	('f6aeb945-6d35-49f7-a0ba-2a50a65c181a', '6ac1d8d3-84c8-46c1-9611-4f826c165649', 'uz', 'Osteoporoz va suyak sog‘ligi: sabablari, belgilari va oldini olish strategiyalari', 'Osteoporoz — suyaklar zichligining pasayishi va mikrostrukturalsizligiga olib keladigan surunkali kasallik. Suyaklar mo‘rt bo‘lib qolishi, sindirish xavfi ortadi. Ko‘p hollarda kasallik asta-sekin rivojlanadi va dastlab alomat bermasligi mumkin.', 'Osteoporoz suyaklar zichligining kamayishi natijasida mo‘rtlikka olib keladigan kasallik bo‘lib, uning sabablari, alomatlari, tashxis va oldini olish usullari bu maqolada batafsil yoritiladi.', 'Osteoporoz – sabablari, alomatlari va oldini olish', 'Osteoporoz suyaklarning mo‘rtlashishi kasalligi. Sabablari, belgilari va oldini olish yo‘llari haqida batafsil o‘qing.', 'osteoporoz-va-suyak-sogligi-sabablari-belgilari-va-oldini-olish-strategiyalari', '2025-09-27 11:23:18.547868+00', '2025-09-27 11:23:18.547868+00'),
	('030cf592-1f2f-4af3-bf2e-c770d9a01677', '6ac1d8d3-84c8-46c1-9611-4f826c165649', 'ru', 'Остеопороз и здоровье костей: причины, симптомы и меры профилактики', 'Остеопороз — заболевание, связанное с уменьшением минеральной плотности костей. В статье рассказывается о причинах, симптомах, диагностике и профилактике.', 'Остеопороз — хроническое заболевание, при котором кости становятся хрупкими. Часто развивается бессимптомно до первой переломности.', 'Остеопороз – причины, симптомы и профилактика', 'Узнайте о причинах, симптомах и профилактике остеопороза.', 'osteoporoz-prichiny-simptomy-profilaktika', '2025-09-27 11:23:18.807688+00', '2025-09-27 11:23:18.807688+00'),
	('a47edc7b-1465-43b9-a866-336d85675a73', '6ac1d8d3-84c8-46c1-9611-4f826c165649', 'en', 'Osteoporosis and Bone Health: Causes, Symptoms, and Prevention', 'Osteoporosis is a chronic condition characterized by reduced bone density and increased fragility. This article explores its causes, symptoms, diagnosis, and prevention strategies.', 'Osteoporosis is a disease where bones become weak and brittle. It often progresses silently until a fracture occurs.', 'Osteoporosis – Causes, Symptoms, Prevention', 'Learn about the causes, symptoms, diagnosis, and prevention of osteoporosis.', 'osteoporosis-causes-symptoms-prevention', '2025-09-27 11:23:18.807688+00', '2025-09-27 11:23:18.807688+00');
